import numpy as np
import random
import matplotlib.pyplot as plt
import time
from PIL import Image

def image_to_pixels(im, islower=True):
    if (islower): return gray_lower(np.asarray(im))
    return np.asarray(im)

def pixels_to_image(pixels):
    new_image = Image.fromarray(pixels)
    new_image.save('new.jpg')

def image_to_pixels_rgb_to_gray(path, islower=True):
    im = Image.open(path).convert('L')
    return image_to_pixels(im)

def gray_lower(x):
    return x.astype("float32") / 255

def save_list_file(ls, name):
    with open(f"weigths {name}.txt", "w") as f:
        for j in range(len(ls)):
            f.write("[")
            for i in range(len(ls[j])):
                f.write(str(ls[j][i]))
                if (i != len(ls[j]) - 1):
                     f.write(", ")
            f.write("]")
            if (j != len(ls) - 1):
                f.write(",")
            f.write("\n")

def load_samples():
    with np.load("mnist.npz") as f:
        pixels_to_image(f['x_train'][0])
        x_train, y_train = f['x_train'].astype("float32") / 255, f['y_train']

        x_train = np.reshape(x_train, (x_train.shape[0], x_train.shape[1] ** 2))
        x_train = np.expand_dims(x_train, 1)

        return x_train, y_train

def sigmoid(x):
    return 1 / (1 + np.exp(-x))

def relu(x):
    return np.maximum(x, 0)

def relu_deriv(x):
    return (x >= 0).astype(float)

def softmax(x_list):
    x = np.exp(x_list)
    return x / np.sum(x)

def cross_entropy(out, ans):
    return -np.log(out[0, ans])

def to_full(ind, size): # Make a list of zeroes, with 1 in a certain index
    y_full = np.zeros((1, size))
    y_full[0][ind] = 1
    return y_full

start = time.time()

x_train, y_train = load_samples()

